void SmallBasic_RegisterPackedAssets() {
    // LiberationSans
    SmallBasic::Platform::Renderer::RegisterResource(L"LiberationSans_Bold.ttf",
        _fileres_sansBold, sizeof(_fileres_sansBold));
    SmallBasic::Platform::Renderer::RegisterResource(L"LiberationSans_BoldItalic.ttf",
        _fileres_sansBoldItalic, sizeof(_fileres_sansBoldItalic));
    SmallBasic::Platform::Renderer::RegisterResource(L"LiberationSans_Italic.ttf",
        _fileres_sansItalic, sizeof(_fileres_sansItalic));
    SmallBasic::Platform::Renderer::RegisterResource(L"LiberationSans_Regular.ttf",
        _fileres_sansRegular, sizeof(_fileres_sansRegular));

    // LiberationSerif
    SmallBasic::Platform::Renderer::RegisterResource(L"LiberationSerif_Bold.ttf",
        _fileres_serifBold, sizeof(_fileres_serifBold));
    SmallBasic::Platform::Renderer::RegisterResource(L"LiberationSerif_BoldItalic.ttf",
        _fileres_serifBoldItalic, sizeof(_fileres_serifBoldItalic));
    SmallBasic::Platform::Renderer::RegisterResource(L"LiberationSerif_Italic.ttf",
        _fileres_serifItalic, sizeof(_fileres_serifItalic));
    SmallBasic::Platform::Renderer::RegisterResource(L"LiberationSerif_Regular.ttf",
        _fileres_serifRegular, sizeof(_fileres_serifRegular));

    // Arial -> LiberationSans
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSans_Bold.ttf",
        L"Arial_Bold.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSans_BoldItalic.ttf",
        L"Arial_BoldItalic.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSans_Italic.ttf",
        L"Arial_Italic.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSans_Regular.ttf",
        L"Arial_Regular.ttf");

    // Georgia -> LiberationSerif
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSerif_Bold.ttf",
        L"Georgia_Bold.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSerif_BoldItalic.ttf",
        L"Georgia_BoldItalic.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSerif_Italic.ttf",
        L"Georgia_Italic.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSerif_Regular.ttf",
        L"Georgia_Regular.ttf");

    // Impact -> LiberationSans (bold)
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSans_Bold.ttf",
        L"Impact_Bold.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSans_BoldItalic.ttf",
        L"Impact_BoldItalic.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSans_BoldItalic.ttf",
        L"Impact_Italic.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSans_Bold.ttf",
        L"Impact_Regular.ttf");
    
    // Times New Roman -> LiberationSerif
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSerif_Bold.ttf",
        L"Times New Roman_Bold.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSerif_BoldItalic.ttf",
        L"Times New Roman_BoldItalic.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSerif_Italic.ttf",
        L"Times New Roman_Italic.ttf");
    SmallBasic::Platform::Renderer::LinkResource(L"LiberationSerif_Regular.ttf",
        L"Times New Roman_Regular.ttf");
    
    SmallBasic::Platform::Renderer::SetDefaultFontName(L"Arial");
}

